import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { Container, Row, Table } from 'react-bootstrap';

class Order extends Component {

  constructor (props) {
    super (props);

    this.order = props.order;
  }

  render() {
    return (
      <div>
        <Container>
          <Row>
            <Table responsive>
              <thead>
                <tr>
                  <th>Order Number</th>
                  <th>Status</th>
                  <th>Created Time</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>1</td>
                  <td>Table cell</td>
                  <td>Table cell</td>
                </tr>
              </tbody>
            </Table>
          </Row>
        </Container>
      </div>
    );
  }
}

export default withRouter(Order);
